description:
Get in the cockpit with the world's best pilots to witness the most challenging flying of their careers!

Follow a young American pilot as he makes his way through Red Flag - the world's most intense, simulated air war, training event - where U.S. and international pilots, ground crews, mechanics and rescue personnel are taken to the limits of their endurance.

Fighter Pilot: Operation Red Flag delivers speeds of up to 800 miles per hour with thundering, roaring, screaming sound and stunning aerobatics that will blow you away! Filmed over the Nevada desert with unprecedented access to military procedures, the film features an enormous armada of aircraft!
